  namespace: NDSH.Geospatial.Gml.Coordinate.Datums
  summary: >-
    <p>
      The <xref href="NDSH.Geospatial.Gml.Coordinate.Datums.EllipsoidType.SecondDefiningParameter" data-throw-if-not-resolved="false"></xref> is a property containing the definition of the second parameter that
      defines the shape of an ellipsoid. An ellipsoid requires two defining parameters:
      <ol><li>Semi-major axis and Inverse flattening</li><li>Semi-major axis and Semi-minor axis</li></ol>
      When the reference body is a sphere rather than an <xref href="NDSH.Geospatial.Gml.Coordinate.Datums.EllipsoidType" data-throw-if-not-resolved="false"></xref>,
      only a single defining parameter is required, namely the radius of the sphere;
      in that case, the semi-major axis "degenerates" into the radius of the sphere.
    </p>

    <p>
      The <code>inverseFlattening</code> element contains the inverse flattening value of the <xref href="NDSH.Geospatial.Gml.Coordinate.Datums.EllipsoidType" data-throw-if-not-resolved="false"></xref>.
      This value is a scale factor (or ratio). It uses <code>gml:LengthType</code> with the restriction that
      the unit of measure referenced by the uom attribute must be suitable for a scale factor,
      such as percent, permil, or parts-per-million.
    </p>

    <p>
      The <code>semiMinorAxis</code> element contains the length of the semi-minor axis of the ellipsoid.
      When the isSphere element is included, the ellipsoid is degenerate and is actually a sphere.
      The sphere is completely defined by the semi-major axis, which is the radius of the sphere.
    </p>
